import axios from "axios";
import React, { useEffect, useState } from "react";

const Inicio = () => {
  const [data, setData] = useState([]);

  useEffect(() => {
    const fetchData = async () => {
      try {
        const respuesta = await axios.get("http://localhost:3000/users");
        setData(respuesta.data);
      } catch (error) {
        console.error("Error no trae la data:", error);
      }
    };
    fetchData();
  }, []);

  return (
    <div className="box-border bg-gradient-to-r from-blue-800 to-blue-400 w-screen h-screen">
      <div className="flex flex-col h-svh gap-7 justify-center items-center">
        <h1 className="bg-clip-text text-transparent text-6xl font-extrabold bg-gradient-to-r from-pink-500 to-orange-500">
          Lista de Usuarios
        </h1>

        <div className="overflow-x-auto">
          <div className=" flex justify-end bg-green-500  flex-initial w-32 ">
            ADD +
          </div>
          <table className=" table-auto min-w-full bg-white rounded-lg shadow-lg">
            <thead>
              <tr className="bg-gradient-to-r from-purple-600 to-blue-500 text-white">
                <th className="py-3 px-6 text-center">ID</th>
                <th className="py-3 px-6 text-center">Nombre</th>
                <th className="py-3 px-6 text-center">Edad</th>
                <th className="py-3 px-6 text-center">Email</th>
                <th className="py-3 px-6 text-center">Teléfono</th>
                <th className="py-3 px-6 text-center">Género</th>
                <th className="py-3 px-6 text-center">Ciudad</th>
                <th className="py-3 px-6 text-center">Acción</th>
              </tr>
            </thead>
            <tbody>
              {data.map((d, i) => (
                <tr
                  key={i}
                  className="bg-white hover:bg-gray-200 transition duration-300"
                >
                  <td className="py-3 px-6">{d.id}</td>
                  <td className="py-3 px-6">{d.name}</td>
                  <td className="py-3 px-6">{d.age}</td>
                  <td className="py-3 px-6">{d.email}</td>
                  <td className="py-3 px-6">{d.phone_number}</td>
                  <td className="py-3 px-6">{d.gender}</td>
                  <td className="py-3 px-6">{d.city}</td>
                  <td className="py-3 px-6">
                    <button className="bg-blue-500 hover:bg-blue-700 text-white font-bold py-2 px-4 mx-1 rounded">
                      Leer
                    </button>
                    <button className="bg-yellow-500 hover:bg-yellow-700 text-white font-bold py-2 px-4 mx-1  rounded">
                      Editar
                    </button>
                    <button className="bg-red-500 hover:bg-red-700 text-white font-bold py-2 px-4 mx-1  rounded">
                      Borrar
                    </button>
                  </td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      </div>
    </div>
  );
};

export default Inicio;
